  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of this report is to create
  a baseline inventory of all non-motorized trails on Silvio O. Conte National Fish
  and Wildlife Refuge. Trails in this inventory are eligible for funding under the
  Refuge Roads Program (SAFETEA_LU). The report describes all the attributes (e.g.,
  location, surface type, condition, distance) of trails in the FWS asset inventory.\",\n\t\"owner_org\":
